import React from 'react';
import styled from 'styled-components';
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <Container>
    <BrowserRouter>
      <Routes>
        <Route />
      </Routes>
    </BrowserRouter>
    </Container>
  );
}

const Container = styled.div`
  width: 100%;
  min-height: inherit;

`

export default App;
